import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Header from './components/common/Header';
import Home from './pages/Home';
import Login from './pages/Login';
import Register from './pages/Register';
import PetTypes from './pages/PetTypes';
import BreedCatalog from './pages/BreedCatalog';
import BreedDetails from './pages/BreedDetails';
import MyPets from './pages/MyPets';
import PetDetailsPage from './pages/PetDetailsPage';
import Articles from './pages/Articles';
import ArticleDetailsPage from './pages/ArticleDetailsPage';
import SavedArticles from './pages/SavedArticles';
import Community from './pages/Community';
import BreedRequest from './pages/BreedRequest';
import Admin from './pages/Admin';
import Profile from './pages/Profile';
import Reminders from './pages/Reminders';
import './styles/App.css';

function App() {
    return (
        <Router>
            <div className="App">
                <Header />
                <main className="main-content">
                    <Routes>
                        <Route path="/" element={<Home />} />
                        <Route path="/login" element={<Login />} />
                        <Route path="/register" element={<Register />} />
                        <Route path="/pet-types" element={<PetTypes />} />
                        <Route path="/breeds/:speciesId" element={<BreedCatalog />} />
                        <Route path="/breed/:id" element={<BreedDetails />} />
                        <Route path="/my-pets" element={<MyPets />} />
                        <Route path="/pet/:id" element={<PetDetailsPage />} />
                        <Route path="/reminders" element={<Reminders />} />
                        <Route path="/articles" element={<Articles />} />
                        <Route path="/article/:id" element={<ArticleDetailsPage />} />
                        <Route path="/saved-articles" element={<SavedArticles />} />
                        <Route path="/community" element={<Community />} />
                        <Route path="/breed-request" element={<BreedRequest />} />
                        <Route path="/admin" element={<Admin />} />
                        <Route path="/profile" element={<Profile />} />
                    </Routes>
                </main>
            </div>
        </Router>
    );
}

export default App;
